@在甲板ONDECK咖啡挺好，河边增加了新植物🌳，连绵的蛙叫有了一瞬间的静气。是开心的。

手从抽签箱里拿出来一点可以看颜色，没有黄色（代表dimoo）的乒乓球就可以把手伸过去重新拿，拿到有黄色再拿出来放到台面上为止！工作人员也没用拿着抽签箱，明明看到了这种行为也不管，纯属割韭菜？？遵守规则的人买了十次八次一次不中，有的人别太恶心。我本来买了六件，看到这种情况果断退款！
白色没中的球抽了之后又拿回箱子里，黄色抽中后就拿出来，概率越来越低。你要么抽了全都拿出来要么都不拿出来这都没人管吗？工作人员视而不见？
